import styled from 'styled-components';

const SideBar = styled.div`
  width: 117px;
  height: 100%;
  background-color: black;
`;

function Sidebar() {
  return (
    <SideBar>
      <div className="icons">
        <span />
      </div>
    </SideBar>
  );
}

export default Sidebar;
